"Necesito comer carne porque me da hierro" #Puesnomiciela necesitas HIERRO no una parte del cuerpo de un animal. Desde legumbres hasta hortalizas, miles de formas de obtenerlo. Gracias @elan.nutricion por la info ✨ 
. 
No es carne, es una parte de un animal que siente al igual que vos o yo. Es alguien, no una cosa, no un objeto inerte. Siente, late, sufre. Hoy podemos cuestionar nuestros consumos y dejar de ser parte. Le cuesta la vida a ellxs, nos genera enfermedades y pandemias, estamos quemando el planeta que habitamos por seguir perpetuando costumbres y hábitos que ya no van más. 
. 
🤔 No renunciamos a nada, podemos seguir comiendo rico y mucho más variado, TODO se puede veganizar 🍔🥪🌭🍕🍲
💰No es caro, no nos basemos en productos. 
🤭 No se te va a caer tu órgano reproductor masculino por dejar de comer animales, el asadito del domingo.
😑 No es elitista ni clasista. Nos enfocamos en  quienes tienen posibilidad de elegir que comer, los recursos y el acceso a la información. 
Y lo más importante, dejamos de financiar la muerte de millones de animales 🐄🐖🐏🐑🐐
.
