Es una especie predadora y migratoria, por lo que se puede encontrar alrededor del mundo.  Su característica principal es un pico largo y aplanado, asemejando a una espada, de ahí su nombre latino gladius (espada),que utiliza para cazar y para defenderse. Los peces espada sonestilizados y tienen la característica de perder todos sus dientes y escamas en su etapa adulta. 
